package main;

import java.util.List;

import classes.Solution2;

public class Main {

	/*
	 * 30
	 * difficulty - HARD
	 * You are given a string, s, and a list of words, words, that are all of the same length. Find all starting indices of 
	 * substring(s) in s that is a concatenation of each word in words exactly once and without any intervening characters.
	 */
	public static void main(String[] args) {
		String s = "a";
		String[] words = {"a"};
		Solution2 sol = new Solution2();
		List<Integer> answer = sol.findSubstring(s, words);
		System.out.print("[");
		for(Integer item : answer) {
			System.out.print(item.intValue()+",");
		}
		System.out.println("]");
	}

}
